get.description:
This query retrieves the list of fields of the application.

This call provides all the lists registered on the server. The fields being considered as a list, they are part of the response sent by the server.

Here is the structure returned by the server:

``` json
{
    "list_name" : {
        "first_list_elem_id" : {
            "displayed_element" : {
                "eng" : "English content",
                "fra" : "Contenu en français",
                …
            }
        },
        "second_list_elem_id" : {
            "displayed_element" : {
                "eng" : "English content",
                "fra" : "Contenu en français",
                …
            }
        }
    },
    "list_name2":{
        …
    },
    …
}

```

Please note that `displayed_value` holds the value of the list item in all languages supported by the application.  
It is also possible to have additional information for each list.


For example, the list `fields`:

``` json
"fields": {
        "unique_id": {
            "placeholder": "AAA-000001",
            "database_type": "string",
            "android_type": "EditText",
            "linked_list": "",
            "required": 0,
            "displayed_value": {
                "eng": "Unique ID",
                "fra": "ID Unique",
                "spa": "Unico ID"
            }
        },
        "gender": {
            "placeholder": "F",
            "database_type": "string",
            "android_type": "Spinner",
            "linked_list": "Gender",
            "required": 0,
            "displayed_value": {
                "eng": "Sex",
                "fra": "Sexe",
                "spa": "Sexo"
            }
        },
        …
}

```

post.description:
This query allows the addition of refugees. The body must be in **json format** and follow the following structure:

``` json
[
    {
        'field_label_1': 'value 1-1',
        'field_label_2': 'value 2-1',
        ...
    },
    {
        'field_label_1': 'value 1-2',
        'field_label_2': 'value 2-3',
        ...
    },
]

```

The server may respond with an error if one of the required fields is not provided or if the data type is wrong.
